    // var img = document.createElement("img"); 

    // img.src = resume; 
    // var src = document.getElementById("x"); 
    // src.appendChild(img); 
    return (
        <div>
            <Hero title = {props.title}/>
            <Content >
                {resume}
            </Content>
        </div>
    );
}

export default AboutPage;
